import React from 'react';
import styles from'./Navbar.module.css'
import { Col } from 'react-bootstrap';
import {NavLink} from "react-router-dom";


const Navbar = () =>{
    return(
        <Col xs='2' className={styles.nav_items_col}>
          <ul className={styles.nav_ul}>
            <li><NavLink to='/profile' className={styles.nav_item}>Profile</NavLink></li>
            <li><NavLink to='/diaologs' className={styles.nav_item}>Messages</NavLink></li>
            <li><NavLink to='#1' className={styles.nav_item}>News</NavLink></li>
            <li><NavLink to='#1' className={styles.nav_item}>Settings</NavLink></li>
            <li><NavLink to='#1' className={styles.nav_item}>Music</NavLink></li>
          </ul>
        </Col>
    )
}
export default Navbar;
